import React from 'react';
import './IndustrySell.css';
import wheatImage from "../assets/industry-sell-image.png"; // Example image import

function IndustrySell() {
  return (
    <div className="industry-sell-container">
      <h2>Sell</h2>
      <div className="sell-form">
        <input type="text" placeholder="Item Name" />
        <input type="number" placeholder="Quantity" />
        <button>List</button>
      </div>
      <div className="items-container">
        {/* Example Card */}
        <div className="card">
          <img src={wheatImage} alt="Wheat" />
          <h3>Wheat Flour</h3>
          <p>Freshly processed</p>
          <p>Quantity: 100kg</p>
        </div>
        {/* Add more cards as needed */}
      </div>
    </div>
  );
}

export default IndustrySell;
